import React from "react";
import 'bootstrap/dist/css/bootstrap.css'; 
import Container from "react-bootstrap/Container"

const AddressBox = () => {
    return (
      <Container
        className="d-flex align-items-center justify-content-center"
        style={{ 
          backgroundColor: 'lightgrey', 
          height: '35vh', // Adjust the height as needed
          width: '30vw', // Adjust the width as needed
          borderRadius: '20px 20px 20px 20px', // Optional: Add border-radius for rounded corners
          boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)', // Optional: Add a box shadow
          marginTop: '4.5vh',
        //   marginRight: '10px'
        }} 
      >

      </Container>
    );
}

export default AddressBox;
